import React, { PureComponent } from 'react'

import './ShopOffers.css'
import Collections from './Collections'
export class ItemDetailSub extends PureComponent {
  render() {
    return (
      <div class='card card-flush pt-3 mb-5 mb-xl-10'>
        {/*begin::Card header*/}
        <div class='card-header'>
          {/*begin::Card title*/}
          <div class='card-title'>
            <h2 class='fw-bolder'>24 KT Gold Ring</h2>
          </div>
          {/*begin::Card title*/}

          {/*begin::Card toolbar*/}
          <div class='card-toolbar'>
            <a
              href='../../demo2/dist/apps/subscriptions/add.html'
              class='btn btn-light-primary'
              style={{
                background: '#95203D',
                width: '100%',
                color: '#ffffff',
              }}
            >
              Place Order
            </a>
          </div>
          {/*end::Card toolbar*/}
        </div>
        {/*end::Card header*/}
        {/*begin::Card body*/}

        <div
          id='kt_content_container'
          className='d-flex flex-column-fluid align-items-start container-xxl '
        >
          <div className='content flex-row-fluid' id='kt_content'>
            <div className='row g-5 g-xl-8 mt-2'>
              <div className='col-xl-12'>
                <Collections />
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default ItemDetailSub
